import axios from 'axios';

import AuthService from "./AuthService";
import  * as apiConstant from "../utils/config";

class UserService {

    getCategory() {
          return axios.get(apiConstant.CATEGORIES_API, AuthService.getHeader());
    }


    getCategoryProduct() {
        return axios.get(apiConstant.CATEGORIES_API, AuthService.getHeader());
   }



} 

export default new UserService();
